import * as React from 'react';
import Box from '@mui/material/Box';
import jobs from "job"
export default function BoxSystemProps() {
  return (
    <Box
      height={200}
      width={200}
      my={4}
      display="flex"
      alignItems="center"
      gap={4}
      p={2}
      sx={{ border: '2px solid grey' }}
    >
      {jobs.slice(0,5).map(job => (
          job.title
        ))}
    </Box>
  );
}
